// COLOR VARIABLES
$color-primary: #c69963;
$color-primary-dark: #b28451;

$color-secondary: #101d2c;

$color-grey-light-1: #f9f7f6;
$color-grey-light-2: #aaa;

$color-grey-dark-1: #54483a;
$color-grey-dark-2: #6d5d4b;

// FONT VARIABLES
$font-primary: "Nunito", sans-serif;
$font-display: "Josefin Sans", sans-serif;

/// RESPONSIVE BREAKPOINTS ///@at-root
$bp-largest: 75rem; // 1200px
$bp-big: 62rem; //982px
$bp-large: 50rem; // 823px
$bp-small: 50rem; // 774px
$bp-smallest: 50.875rem; //558px
$bp-tiny: 26.625rem; //468px

*,
*::before,
*::after {
    margin: 0;
    padding: 0;
    box-sizing: inherit;
}

html {
    box-sizing: border-box;
    font-size: 62.5%; //1 rem = 10px

    @media (max-width: $bp-largest) {
        font-size: 60%;
    }
}

body {
    font-family: $font-primary;
    color: $color-grey-dark-2;
    font-weight: 300;
    line-height: 1.6;
}

.container {
    display: grid;

    grid-template-rows: 80vh min-content 40vw repeat(3, min-content);
    grid-template-columns:
        [sidebar-start] 8rem [sidebar-end full-start] minmax(6rem, 1fr)
        [center-start] repeat(
            8,
            [col-start] minmax(min-content, 14rem) [col-end]
        )
        [center-end]
        minmax(6rem, 1fr) [full-end];

    & > * {
    }

    @media (max-width: $bp-largest) {
        grid-template-rows: 8rem 80vh min-content 40vw repeat(3, min-content);
        grid-template-columns:
            [full-start] minmax(6rem, 1fr)
            [center-start] repeat(
                8,
                [col-start] minmax(min-content, 14rem) [col-end]
            )
            [center-end]
            minmax(6rem, 1fr) [full-end];
    }

    @media (max-width: $bp-big) {
        grid-template-rows: 8rem calc(100vh - 8rem);
    }

    @media (max-width: $bp-small) {
        grid-template-columns:
            [full-start] 1fr
            [center-start] repeat(8, [col-start] min-content [col-end])
            [center-end]
            1fr [full-end];
    }
}

sources.sass/_typography.scss:
@mixin base-style {
    font-family: $font-display;
    font-weight: 400;
}

.heading-1 {
    @include base-style;
    font-size: 5.3rem;
    color: $color-grey-light-1;
    line-height: 1;
}

.heading-2 {
    @include base-style;
    font-size: 4rem;
    font-style: italic;
    line-height: 1;

    &--light {
        color: $color-grey-light-1;
    }

    &--dark {
        color: $color-grey-dark-1;
    }
}

.heading-3 {
    @include base-style;
    font-size: 1.6rem;
    color: $color-primary;
    text-transform: uppercase;
}

.heading-4 {
    @include base-style;
    font-size: 1.9rem;

    &--light {
        color: $color-grey-light-1;
    }

    &--dark {
        color: $color-grey-dark-1;
    }
}

.btn {
    background-color: $color-primary;
    color: white;
    border: none;
    border-radius: 0;
    font-family: $font-display;
    text-transform: uppercase;
    padding: 1.8rem 3rem;
    cursor: pointer;
    transition: all 0.4s;
    outline: none;

    &:hover {
        background-color: $color-primary-dark;
    }
}

// helper classes of margin

.mb-small {
    margin-bottom: 2rem;
}

.mb-medium {
    margin-bottom: 3rem;
}

.mb-large {
    margin-bottom: 4rem;
}

.mb-huge {
    margin-bottom: 8rem;
}

sources.sass/_sidebar.scss:
.sidebar {
    background-color: $color-primary;
    grid-column: sidebar-start / sidebar-end;
    grid-row: 1 / -1;

    @media (max-width: $bp-largest) {
        grid-row: 1 / 2;
        grid-column: 1 / -1;
    }
}

.ayo__logo {
    display: flex;

    justify-self: center;
    padding: 1rem;
    // mix-blend-mode: darken;

    box-shadow: 0 2rem 4rem rgba(0, 0, 0, 0.2);
    border-radius: 100rem;

    @media (max-width: $bp-largest) {
        border-radius: initial;
        padding: initial;
        box-shadow: initial;
    }

    &--1 {
        border-radius: 500%;

        // display: block;
        margin-left: 3px;

        transition: all 0.7s;
        // padding-top: 3rem;
        margin-top: 3rem;
        width: 5rem;

        @media (max-width: $bp-largest) {
            border-radius: 500%;
            width: 5.5rem;
            margin-left: 1.5rem;
            margin-top: 1.5rem;
            transition: 1s;
        }
    }

    &--1:hover {
        transform: translateY(-2px);
        border-radius: 100rem;
        margin-top: 2.1rem;

        // mix-blend-mode: darken;

        @media (max-width: $bp-largest) {
            margin-left: 1.5rem;
            margin-top: 1.5rem;
        }
    }
}

sources.sass/_header.scss:
.header {
    background-color: $color-grey-dark-1;

    grid-column: full-start / col-start 6;

    background-image: linear-gradient(
            rgba($color-secondary, 0.93),
            rgba($color-secondary, 0.93)
        ),
        url(../img/hero.jpeg);

    background-size: cover;
    background-position: center;

    padding: 8rem;
    padding-top: 6rem;

    display: grid;

    grid-template-rows: 1fr min-content minmax(min-content, 6rem) 1fr;

    grid-row-gap: 1.5rem;
    justify-content: center;

    @media (max-width: $bp-big) {
        grid-column: 1 /-1;
    }

    &-main {
        font-size: 1.7rem;
    }

    &__logo {
        height: 3rem;
        justify-self: center;
    }

    &__btn {
        align-self: start;
        justify-self: start;
        font-size: 1.5rem;
    }

    &__seenon-text {
        display: grid;
        font-size: 1.6rem;
        color: $color-grey-light-1;

        grid-template-columns: 1fr max-content 1fr;
        align-items: center;
        grid-column-gap: 2rem;
        filter: brightness(50%);

        &::before,
        &::after {
            content: "";
            height: 1px;
            display: block;
            background-color: currentColor;
        }
    }

    &__seenon-logos {
        display: grid;
        grid-template-columns: repeat(4, 1fr);
        grid-column-gap: 3rem;
        justify-items: center;
        align-items: center;

        img {
            max-height: 2.5rem;
            max-width: 100%;

            filter: brightness(50%);
        }
    }
}

sources.sass/_realtors.scss:
.realtors {
    background-color: $color-secondary;

    grid-column: col-start 6 / full-end;

    display: grid;
    align-content: center;
    justify-content: center;

    grid-row-gap: 2rem;
    justify-items: center;

    @media (max-width: $bp-big) {
        grid-column: 1 /-1;
    }
}

.realtors {
    @media (max-width: $bp-big) {
        padding-top: 5rem;
    }

    &__list {
        display: grid;
        grid-template-columns: min-content max-content;
        grid-column-gap: 2rem;
        grid-row-gap: 5vh;
        align-items: center;

        @media (max-width: $bp-big) {
            grid-template-columns: repeat(3, min-content max-content);
            grid-column-gap: 2rem;
            padding-top: 2rem;
            padding-bottom: 6rem;
        }

        @media (max-width: $bp-small) {
            grid-template-columns: max-content max-content;
        }
    }

    &__img {
        width: 6rem;
        border-radius: 50%;
        display: block;
        box-shadow: 0 -4rem 15rem rgba(white, 1);
    }

    &__sold {
        text-transform: uppercase;
        color: $color-grey-light-2;
        margin-top: -3px;
        font-size: 1.2rem;
    }

    &__ayo:link {
        animation: bounce 2s infinite;
    }

    &__ayo:visited,
    &__ayo:active,
    &__ayo:hover {
        animation: bounce 2s infinite;
    }
}

@keyframes bounce {
    0% {
        transform: translateY(0px);
    }

    50% {
        transform: translateY(-10px);
    }
    100% {
        transform: translateY(0px);
    }
}

sources.sass/_features.scss:
.features {
    grid-column: center-start / center-end;

    margin: 15rem 0;
    display: grid;
    // grid-template-columns: repeat(3, 1fr);

    grid-template-columns: repeat(auto-fit, minmax(30rem, 1fr));

    grid-gap: 6rem;

    // align-items: start;

    @media (max-width: $bp-large) {
        margin: 7rem 0;
        grid-template-columns: repeat(auto-fit, minmax(50rem, 1fr));
    }

    @media (max-width: $bp-smallest) {
        margin: 7rem 0;
        grid-template-columns: repeat(auto-fit, minmax(40rem, 1fr));
    }

    @media (max-width: $bp-tiny) {
        margin: 7rem 0;
        grid-template-columns: repeat(auto-fit, minmax(15rem, 1fr));
    }
}

.feature {
    display: grid;

    grid-template-columns: min-content 1fr;
    grid-row-gap: 1.5rem;
    grid-column-gap: 2.5rem;
    padding: 3rem 3rem;

    box-shadow: 0 2rem 4rem rgba(black, 0.1);
    transition: all 0.3s;

    &__icon {
        fill: $color-primary;
        width: 4.5rem;
        height: 4.5rem;

        grid-row: 1 / span 2;
    }

    &__text {
        font-size: 1.7rem;
    }
}

.feature:hover {
    transform: translateY(-10px);
}

sources.sass/_story.scss:
.story {
    &__pictures {
        background-color: $color-primary;
        background-image: linear-gradient(
                rgba($color-primary, 0.5),
                rgba($color-primary, 0.5)
            ),
            url(../img/back.jpg);

        grid-column: full-start / col-end 4;

        display: grid;
        grid-template-rows: repeat(6, 1fr);
        grid-template-columns: repeat(6, 1fr);
        align-items: center;

        @media (max-width: $bp-big) {
            grid-column: full-start / full-end;
            grid-template-rows: repeat(10, 1fr);
            grid-template-columns: repeat(8, 1fr);
            height: 60vh;
        }

        @media (max-width: $bp-small) {
            height: 45vh;
        }
        @media (max-width: $bp-smallest) {
            min-height: 50rem;
        }
    }

    &__img--1 {
        width: 100%;

        grid-column: 2 / 6;
        grid-row: 2 / 5;
        box-shadow: 0 2rem 5rem rgba(black, 0.1);
        transition: all 1s;

        @media (max-width: $bp-big) {
            grid-row: 3 / 7;
        }

        @media (max-width: $bp-large) {
            grid-row: 2 / 7;
        }

        @media (max-width: $bp-small) {
            grid-column: 2 / 6;
            grid-row: 3 / 6;
        }

        @media (max-width: $bp-smallest) {
            grid-column: 2 / 8;
            grid-row: 3 / 6;
        }
    }

    &__img--2 {
        width: 115%;
        grid-column: 4 / 8;
        grid-row: 4 / 9;
        z-index: 10;

        box-shadow: 0 2rem 5rem rgba(black, 0.4);
        transition: all 1s;

        @media (max-width: $bp-big) {
            grid-row: 6 / 9;
        }

        @media (max-width: $bp-large) {
            grid-row: 6 / 10;
        }

        @media (max-width: $bp-small) {
            grid-column: 5 / 8;
            grid-row: 6 / 10;
        }

        @media (max-width: $bp-smallest) {
            grid-column: 3 / 8;
            grid-row: 6 / 10;
        }
    }

    &__img--1:hover,
    &__img--2:hover {
        transform: translateY(-10px);
    }

    &__content {
        /// flex box solution
        // display: flex;
        // flex-direction: column;
        // justify-content: center;
        // align-items: flex-start;

        /// grid solution

        display: grid;
        align-content: center;
        justify-items: start;

        background-color: $color-grey-light-1;

        grid-column: col-end 4 / full-end;

        padding: 6rem 8vw;

        @media (max-width: $bp-big) {
            grid-column: full-start / full-end;
            max-width: 100vh;
            min-height: 45rem;
        }

        @media (max-width: $bp-smallest) {
            max-width: 100vh;
            min-height: 50rem;
        }
    }

    &__text {
        font-size: 1.5rem;
        font-style: italic;
        margin-bottom: 4rem;
    }
}

sources.sass/_homes.scss:
.homes {
    grid-column: center-start / center-end;
    margin: 15rem 0;

    display: grid;
    grid-template-columns: repeat(auto-fit, minmax(25rem, 1fr));

    grid-gap: 7rem;

    @media (max-width: $bp-largest) {
        grid-template-columns: repeat(auto-fit, minmax(30rem, 1fr));
    }
    @media (max-width: $bp-large) {
        margin: 7rem 0;
    }

    @media (max-width: $bp-smallest) {
        margin: 7rem 0;
    }
}

.home {
    background-color: $color-grey-light-1;

    display: grid;

    grid-template-columns: repeat(2, 1fr);

    grid-row-gap: 3.5rem;

    box-shadow: 0 2rem 4rem rgba(black, 0.2);

    transition: all 1s;

    &__img {
        width: 100%;
        grid-column: 1 / -1;
        grid-row: 1/ 2;
        z-index: 1;
    }

    &__like {
        fill: $color-primary;
        height: 2rem;
        width: 2.5rem;
        grid-row: 1/ 2;
        grid-column: 2/ 3;
        z-index: 2;
        justify-self: end;
        margin: 1rem;
    }

    &__name {
        grid-column: 1 / 3;
        grid-row: 1 / 2;
        z-index: 3;
        align-self: end;
        transform: translateY(50%);

        width: 80%;
        justify-self: center;

        font-family: $font-display;
        font-size: 1.6rem;
        font-weight: 400;
        text-align: center;
        padding: 1.25rem;
        background-color: $color-secondary;
        color: white;
        transition: all 0.4s;

        &:hover {
            background-color: lighten($color-secondary, 7%);
        }
    }

    &__location,
    &__rooms {
        margin-top: 2.5rem;
    }

    &__location,
    &__rooms,
    &__area,
    &__price {
        grid-template-columns: 1fr 2fr;
        font-size: 1.5rem;

        display: grid;

        svg {
            fill: $color-primary;
            height: 2rem;
            width: 2rem;
            justify-self: end;
        }

        p {
            align-self: center;
            margin-left: 0.7rem;
        }
    }

    &__btn {
        grid-column: 1 / 3;
    }
}

.home:hover {
    transform: translateY(-10px);
}

sources.sass/_gallery.scss:
.gallery {
    background-color: $color-secondary;

    grid-column: full-start / full-end;

    display: grid;
    grid-template-columns: repeat(8, 1fr);
    grid-template-rows: repeat(7, 5vw);
    grid-gap: 1.5rem;
    padding: 1.5rem;

    &__item {
        box-shadow: 0 -4rem 15rem rgba($color-secondary, 0.3);
        &--1 {
            grid-row: 5 / 8;
            grid-column: 5 / 8;
        }

        &--2 {
            grid-row: 3 / 6;
            grid-column: 1 / 3;
        }

        &--3 {
            grid-row: 4 / 5;
            grid-column: 5 / 6;
        }

        &--4 {
            grid-row: 1 / 4;
            grid-column: 3 / 5;
        }

        &--5 {
            grid-row: 6 / 8;
            grid-column: 1 / 2;
        }

        &--6 {
            grid-row: 6 / 8;
            grid-column: 2 / 4;
        }

        &--7 {
            grid-row: 6 / 8;
            grid-column: 4 / 5;
        }

        &--8 {
            grid-row: 3 / 5;
            grid-column: 6 / 8;
        }

        &--9 {
            grid-row: 1 / 4;
            grid-column: 5 / 6;
        }

        &--10 {
            grid-row: 4 / 6;
            grid-column: 3 / 5;
        }

        &--11 {
            grid-row: 1 / span 2;
            grid-column: 1 / span 2;
        }

        &--12 {
            grid-row: 1 / 3;
            grid-column: 6 / 9;
        }

        &--13 {
            grid-row: 3 / 6;
            grid-column: 8 / 9;
        }

        &--14 {
            grid-row: 6 / 8;
            grid-column: 8 / 9;
        }
    }

    &__img {
        width: 100%;
        height: 100%;
        object-fit: cover;
        display: block;
    }
}

sources.sass/_footer.scss:
.footer {
    background-color: $color-secondary;

    grid-column: full-start / full-end;

    padding: 8rem;

    &__copyright {
        font-size: 1.5rem;
        padding-top: 4rem;
        text-align: center;

        &--link {
            padding: 0.5rem 3rem;
            display: block;
            transition: all 0.8s;
        }

        &--link:link,
        &--link:visited,
        &--link:active {
            color: rgba(white, 0.5);
            text-decoration: none;
        }

        &--link:hover {
            background-color: rgba(white, 0.05);

            transform: translateY(-7px);
        }
    }
}

.nav {
    list-style: none;

    display: grid;
    grid-template-columns: repeat(auto-fit, minmax(15rem, 1fr));
    grid-template-rows: 1fr;
    grid-gap: 2rem;

    align-items: center;

    @media (max-width: $bp-largest) {
        grid-template-columns: repeat(auto-fit, minmax(10rem, 1fr));
    }

    @media (max-width: $bp-large) {
        grid-template-columns: repeat(auto-fit, minmax(20rem, 1fr));
    }

    &__link:link,
    &__link:visited {
        font-size: 1.5rem;
        color: white;
        text-decoration: none;
        font-family: $font-display;
        text-transform: uppercase;
        text-align: center;
        display: block;

        padding: 0.5rem 1.5rem;

        transition: all 0.2s;
    }

    &__link:hover,
    &__link:active {
        background-color: rgba(white, 0.05);
        transform: translateY(-3px);
    }
}
